import React from 'react';
import contact from './contact.module.css'
import { Link } from "react-router-dom";
import image_why from '../../../assets/img/replace image.jpg'
import { Formik, Form, Field } from 'formik';

const validateEmail = value => {
	let error;
	if (!value) {
		error = 'Required';
	} else if (!/^[A-Z0-9._%+-]+@[A-Z0-9.-]+\.[A-Z]{2,4}$/i.test(value)) {
		error = 'Invalid email address';
	}
	return error;
}

const validateText = value => {
	let error;
	if (!value) error = 'Required';

	return error;
}

const submit = async (values) => {
	await new Promise((r) => setTimeout(r, 500));
	alert(JSON.stringify(values, null, 5));
}

export const Contact = () => {
	return (
		<section className={contact.page__contact + ' ' + contact.contact} id={"form"}>
			<div className={contact.contact__container}>
				<h2 className={contact.conatct__title + " title"}>Contact us</h2>
					<Form />
			</div>
		</section>
	);
};

const TextArea = (props) => (
	<textarea className={contact.form__control + ' ' + contact.form__control_textarea} {...props} />
);
